import React, { Component } from "react";
import "./App.css";
import { ToggleButton } from "react-bootstrap";
import { ToggleButtonGroup } from "react-bootstrap";

function App() {
  return (
    <div className="App">
      <ButtonGroup type="radio" name="options">
        <ToggleButton value={1} variant="outline-primary" size="lg">
          +
        </ToggleButton>
        <ToggleButton value={2} variant="outline-danger" size="lg">
          -
        </ToggleButton>
      </ButtonGroup>
    </div>
  );
}

export default App;
